import Header from "../../components/Header";
import background from '../../assets/background.svg';
import "./styles.css"

function App() {
  return (
    <div className="App">
      <Header />
      <div className="conteudo">
          <img src={background} className="background" alt="background app"/>
          <div className="info">
            <div>
              <input name=""/>
            </div>
          </div>
      </div>
    </div>
  );
}

export default App;
